import React from 'react';

interface InfoBoxProps {
  imageSrc: string;
  title: string;
  content: string;
}

const InfoBox: React.FC<InfoBoxProps> = ({ imageSrc, title, content }) => {
  return (
    <div className="bg-purple-50 p-4 rounded-lg shadow-sm hover:shadow-md transition-shadow">
      <div className="flex items-center mb-2">
        <div className="w-8 h-8 mr-3"> {/* Adjust size as needed */}
          <img 
            src={imageSrc}
            alt={title}
            className="w-full h-full object-contain"
          />
        </div>
        <h4 className="font-medium text-purple-700">{title}</h4>
      </div>
      <p className="text-sm text-gray-600">{content}</p>
    </div>
  );
};

export default InfoBox;
